import React from "react";
import { Grid, Container } from "semantic-ui-react";
import NavBar from "./navegation/NavBar";
import RealMap from "./map/RealMap";
function App() {
  return (
    <div>
      <NavBar />
      <Grid>
        <Grid.Column mobile={16} largeScreen={4} >Charts</Grid.Column>
        <Grid.Column  mobile={16} largeScreen={12}>
            <RealMap />
        </Grid.Column>
      </Grid>
    </div>
  );
}

export default App;
